(async function() {
    try {
        // 解压JS代码
        const compressed = Uint8Array.from(atob(""), c => c.charCodeAt(0));
        const ds = new DecompressionStream('gzip');
        const stream = new Response(compressed).body.pipeThrough(ds);
        const result = await new Response(stream).arrayBuffer();
        const jsCode = new TextDecoder().decode(result);
        
        // 动态创建script标签加载（确保全局作用域）
        const script = document.createElement('script');
        script.textContent = jsCode;  // 直接设置代码内容
        
        // 添加到DOM执行
        document.head.appendChild(script);
        
        console.log('✅ 动态加载JS成功');
    } catch(error) {
        console.error('❌ JS加载失败:', error);
    }
})();